function CommunityPage() {
    return (
        <section className='post_main'>
            <figure className='banner_com'>
                <img src={banner_com} alt="" />
            </figure>
            <h1>推薦話題</h1>
            <div>
                <div className='recipe'><img src={recipe} alt="" /></div>
                <div className='ill'><img src={ill} alt="" /></div>
                <div className='gluten'><img src="" alt="" /></div>
                <div className='gluten_eat'><img src="" alt="" /></div>

            </div>




        </section>




        );
    }
